import React, { Component } from 'react';
import './App.css';

class Main extends Component {

    render(){
      return(
        <div className="main">
        <div className="maintext">
          <div className="maintitle">
            Start your Oxbridge journey.
          </div>
          <a href="#whyapply">
          <div className="findouthow">
              Find out how.
            </div>
            </a>
        </div>
        </div>
      )
    }
  }

export default Main
